import styled from 'styled-components'

export const Container = styled.nav`
width: 100%;
position: absolute;
top:0;
left: 0;
`
export const List = styled.ul`
    display: flex;

`
export const Elements = styled.li`
    list-style: none;
`
export const Links = styled.a`
    display: block;
    text-decoration: none;
`
